// SPDX-License-Identifier: MIT
// Compatible with OpenZeppelin Contracts ^5.0.0
pragma solidity ^0.8.22;

import {Ownable} from "@openzeppelin/contracts/access/Ownable.sol";
import "@openzeppelin/contracts/token/ERC20/IERC20.sol";

contract DiscoCats is Ownable {
    uint public projectCount=0;
    struct Briber{
        address briberAddress;
        address tokenAddress;
        uint tokenAmnt;
    }
    struct Project {
        
        string name;
        address projectOwner;
        mapping (address=>Briber)bribers;
        uint votes;

    }

   
    // Project[] public projects;
    mapping(uint=>Project) public  projects;
    constructor(address initialOwner) Ownable(initialOwner) {}

    function initializeProject(string memory _name)public  {
        // Project memory tempProject;

       projectCount++;
       //Project[projectCount];
        Project storage newProject = projects[projectCount];
       newProject.name=_name;
       newProject.projectOwner=msg.sender;
       newProject.votes=0;
       

    }
    function incentiviseProject(uint id,address _tokenAddress, uint256 _tokenAmount)public {
       

        require(_tokenAmount > 0, "Amount must be greater than 0");
        require(IERC20(_tokenAddress).balanceOf(msg.sender) >= _tokenAmount, "Insufficient token balance");
        
        require(IERC20(_tokenAddress).approve(address(this),_tokenAmount));
        
        IERC20(_tokenAddress).transferFrom(msg.sender, address(this), _tokenAmount);
        Project storage newProject = projects[id];
        // Briber tempBriber = projects[id];
        newProject.bribers[msg.sender].briberAddress=msg.sender;
        newProject.bribers[msg.sender].tokenAddress=_tokenAddress;
        newProject.bribers[msg.sender].tokenAmnt=_tokenAmount;

       

    }
}

